import {Container, Row, Col} from "react-bootstrap";
import Image from 'react-bootstrap/Image'

function Footer({text}) {

    return (
        <>
            <Container fluid>
                <Row>
                    <Col lg={4}> <img src="./logo192.png" className="img-fluid" alt="Logo"/> </Col>
                    <Col lg={8}>My Website!</Col>
                </Row>
                <Row>
                    <Col>1 of 3</Col>
                    <Col>2 of 3</Col>
                    <Col>3 of 3</Col>
                </Row>
                <Row>
                    <Col>Footer</Col>

                </Row>
            </Container>
        </>
    );
}

export default Footer;
